        public static IEnumerable<object[]> Data
        {
            get
            {
                foreach (var line in data.Split(new[] { '\r', '\n' }, StringSplitOptions.RemoveEmptyEntries))
                {
                    yield return
                        line.Split(' ', StringSplitOptions.RemoveEmptyEntries)
                        .Select(p => p.ParseDouble() as object)
                        .ToArray();
                }
            }
        }

